() => {
		let activesAssociates = getAllActivesAssociates.data
		let actives = activesAssociates.filter((ass) => ass.data_desfiliacao == "").length
		let removed = activesAssociates.filter(ass => ass.data_desfiliacao != "").length
		let pastMonth = moment().subtract(1, "month").format("/MM/")
		let associatesRemovedLastMonth = activesAssociates.filter((ass) => ass.data_desfiliacao != "" && ass.data_desfiliacao.includes(pastMonth)).length
		let associatesIncludedLastMonth = activesAssociates.filter((ass) => ass.data_desfiliacao == "" && ass.data_filiacao.includes(pastMonth)).length
		return {
			associatesIncludedLastMonth,
			associatesRemovedLastMonth
		}
	}

